package com.leecode;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

/**
 * @author liuyuze
 * @date 2025/5/9 14:26
 */
public class _0242IsAnagram {
    /**
     * 242. 有效的字母异位词
     * 简单
     * 相关标签
     * 相关企业
     * 给定两个字符串 s 和 t ，编写一个函数来判断 t 是否是 s 的 字母异位词。
     *
     *
     *
     * 示例 1:
     *
     * 输入: s = "anagram", t = "nagaram"
     * 输出: true
     * 示例 2:
     *
     * 输入: s = "rat", t = "car"
     * 输出: false
     *
     *
     * 提示:
     *
     * 1 <= s.length, t.length <= 5 * 104
     * s 和 t 仅包含小写字母
     *
     *
     * 进阶: 如果输入字符串包含 unicode 字符怎么办？你能否调整你的解法来应对这种情况？
     * @param s
     * @param t
     * @return
     */
    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        Map<Character, Integer> mapS = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            Integer num = mapS.getOrDefault(s.charAt(i), 0);
            mapS.put(s.charAt(i), num + 1);
        }
        Map<Character, Integer> mapT = new HashMap<>();
        for (int i = 0; i < t.length(); i++) {
            Integer num = mapT.getOrDefault(t.charAt(i), 0);
            mapT.put(t.charAt(i), num + 1);
        }
        Set<Character> setS = mapS.keySet();
        Set<Character> setT = mapT.keySet();
        if (setS.size() != setT.size()) {
            return false;
        }
        for (Character c : setT) {
            Integer i = mapS.get(c);
            Integer j = mapT.get(c);
            if (i == null || j == null || i.compareTo(j) != 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        // System.out.println(isAnagram("anagram", "nagaram"));
        // System.out.println(isAnagram("rat", "car"));
        System.out.println(isAnagram("",
                ""));
    }
}
